import * as React from "react";
import Box from "@mui/material/Box";
import { Grid, IconButton, Link, Typography, Stack } from "@mui/material";
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
import InstagramIcon from "@mui/icons-material/Instagram";
import YouTubeIcon from "@mui/icons-material/YouTube";
import LinkedInIcon from "@mui/icons-material/LinkedIn";

function Contact() {
  return (
    <>
      <Box
        component="main"
        textAlign="center"
        sx={{ p: 3, backgroundColor: "#ddd" }}
      >
        <Stack spacing={2} direction="row" justifyContent="space-evenly" mb={1}>
          <Box>sdfmnsdkfns</Box>
          <Box>
            {" "}
            <form onSubmit={handleSubmit}>
              <Box>
                {/* form login start */}
                {isLogin && (
                  <>
                    {/* <Stack
              direction="row"
              justifyContent="space-between"
              alignItems="center"
              spacing={2}
            >
              <Typography sx={{ fontSize: "2.125rem", fontWeight: 600 }}>
                Login
              </Typography>
              <Tooltip
                placement="bottom"
                title="Lorem Ipsum is simply dummy text of the printing and typesetting industry."
              >
                <IconButton>
                  <InfoOutlinedIcon fontSize="medium" />
                </IconButton>
              </Tooltip>
            </Stack> */}
                    <Typography
                      sx={{
                        fontSize: "1.75rem",
                        fontWeight: 400,
                        marginBottom: "0.5rem",
                      }}
                    >
                      {`Let's Start`}
                    </Typography>
                    <Box>
                      <InputComponent
                        // label="Email / Mobile"
                        placeholder="Email Address / Mobile number"
                        error={errors && errors.email ? true : false}
                        erorrtext={errors.email}
                        name="email"
                        type="text"
                        value={values.email}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        sx={{ margin: 0, paddingBottom: "2rem" }}
                      />
                      <InputComponent
                        // label="Password"
                        type={showPassword ? "text" : "password"}
                        error={errors && errors.password ? true : false}
                        erorrtext={errors.password}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        value={values.password}
                        placeholder="Password"
                        autoComplete="on"
                        name="password"
                        sx={{ margin: 0, paddingBottom: "1rem" }}
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton
                                aria-label="toggle password visibility"
                                edge="end"
                                onClick={handleClickShowPassword}
                                onMouseDown={handleMouseDownPassword}
                              >
                                {showPassword ? (
                                  <VisibilityOffOutlinedIcon />
                                ) : (
                                  <VisibilityOutlinedIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          ),
                        }}
                      />
                    </Box>
                    <Typography
                      textAlign="right"
                      variant="body2"
                      color="textSecondary"
                      onClick={handleForgotPassword}
                    >
                      <Link href="javascript: ;">Forgot Password</Link>
                    </Typography>
                    <Stack
                      direction="row"
                      justifyContent="space-between"
                      alignItems="center"
                      spacing={2}
                    >
                      <LoadingButton
                        loadingPosition="end"
                        endIcon={<></>}
                        loading={isLoading}
                        size="large"
                        type="submit"
                        variant="contained"
                        sx={{
                          width: "190px",
                          color: "#fff",
                          backgroundColor: "#009173",
                          fontSize: "1.688rem",
                          padding: "3px 0px",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                            width: "120px",
                          },
                        }}
                      >
                        Login
                      </LoadingButton>
                      <Typography
                        variant="body2"
                        textAlign="center"
                        color="lightblue"
                        onClick={handleLoginwithOTP}
                        sx={{
                          color: "#000",
                          fontSize: "18px",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                          },
                        }}
                      >
                        <Link href="javascript: ;">Login with OTP</Link>
                      </Typography>
                    </Stack>
                    <Typography color="textSecondary" variant="body2" mt={1}>
                      Login in with your credentials shared with you on your
                      registered mail ID.
                    </Typography>
                  </>
                )}
             

                {/* form forgot password start */}
                {isForgotForm && (
                  <>
                    <Stack
                      direction="row"
                      justifyContent="space-between"
                      alignItems="center"
                      spacing={2}
                    >
                      <Typography
                        sx={{ fontSize: "2.125rem", fontWeight: 600 }}
                      >
                        Forgot Your Password
                      </Typography>
                      {/* <InfoOutlinedIcon fontSize="small" /> */}
                    </Stack>
                    <Typography
                      sx={{
                        fontSize: "1.125rem",
                        fontWeight: 400,
                        marginTop: "2rem",
                        marginBottom: "0.3rem",
                      }}
                    >
                      Enter your registered mobile number below to receive OTP
                    </Typography>
                    <Box>
                      <InputComponent
                        // label="Mobile OTP"
                        placeholder="Enter Mobile Number"
                        name="forgotmobileno"
                        type="text"
                        error={errors && errors.forgotmobileno ? true : false}
                        erorrtext={errors.forgotmobileno}
                        value={values.forgotmobileno}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        sx={{ margin: 0, paddingBottom: "5rem" }}
                      />
                    </Box>
                    <Stack
                      direction="row"
                      justifyContent="space-between"
                      alignItems="center"
                      spacing={2}
                    >
                      <LoadingButton
                        loadingPosition="end"
                        endIcon={<></>}
                        loading={isLoading}
                        size="large"
                        type="submit"
                        variant="contained"
                        sx={{
                          width: "190px",
                          color: "#fff",
                          backgroundColor: "#009173",
                          fontSize: "1.688rem",
                          padding: "3px 0px",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                            width: "120px",
                          },
                        }}
                      >
                        Send OTP
                      </LoadingButton>
                      <Typography
                        variant="body2"
                        textAlign="center"
                        color="lightblue"
                        onClick={handleBack}
                        sx={{
                          color: "#000",
                          pr: "3rem",
                          fontSize: "1.3rem",
                          fontWeight: "400",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                          },
                        }}
                      >
                        <Link href="javascript: ;">Back</Link>
                      </Typography>
                    </Stack>
                  </>
                )}
                {isForgotFormOtp && (
                  <>
                    <Stack
                      direction="row"
                      justifyContent="space-between"
                      alignItems="center"
                      spacing={2}
                    >
                      <Typography
                        sx={{ fontSize: "2.125rem", fontWeight: 600 }}
                      >
                        Forgot your password
                      </Typography>
                      {/* <InfoOutlinedIcon fontSize="small" /> */}
                    </Stack>
                    <Box sx={{ mt: "2rem" }}>
                      <InputLabel shrink htmlFor="bootstrap-input">
                        Mobile OTP
                      </InputLabel>
                      <InputComponent
                        placeholder="Enter the OTP received on your mobile"
                        name="forgotMobilenoOtp"
                        type="text"
                        value={values.forgotMobilenoOtp}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        maxLength={4}
                        error={
                          errors && errors.forgotMobilenoOtp ? true : false
                        }
                        erorrtext={errors.forgotMobilenoOtp}
                        sx={{ margin: 0, paddingBottom: "5rem" }}
                      />
                    </Box>
                    <Stack
                      direction="row"
                      justifyContent="space-between"
                      alignItems="center"
                      spacing={2}
                    >
                      <LoadingButton
                        loadingPosition="end"
                        endIcon={<></>}
                        loading={isLoading}
                        size="large"
                        type="submit"
                        variant="contained"
                        sx={{
                          width: "190px",
                          color: "#fff",
                          backgroundColor: "#009173",
                          fontSize: "1.688rem",
                          padding: "3px 0px",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                            width: "120px",
                          },
                        }}
                      >
                        Submit
                      </LoadingButton>
                      <Typography
                        variant="body2"
                        textAlign="center"
                        color="lightblue"
                        onClick={editForgotMobileNo}
                        sx={{
                          color: "#000",
                          fontSize: "1rem",
                          "@media (max-width: 600px)": {
                            fontSize: "15px",
                          },
                        }}
                      >
                        <Link href="javascript: ;">Edit Mobile Number</Link>
                      </Typography>
                    </Stack>
                  </>
                )}
               
              </Box>
            </form>
          </Box>
        </Stack>
      </Box>
    </>
  );
}
export default Contact;
